// frontend/src/components/products/ProductFilter.jsx
import React, { useState, useEffect } from 'react';
import { getCategories, getProducers, getLocations } from '../../services/api';

/**
 * Componente ProductFilter - Filtros para productos
 * Permite filtrar productos por categoría, productor, ubicación y precio
 */
const ProductFilter = ({ filters, onFilterChange, onClearFilters }) => {
  const [categories, setCategories] = useState([]);
  const [producers, setProducers] = useState([]);
  const [locations, setLocations] = useState([]);

  useEffect(() => {
    loadFilterData();
  }, []);

  const loadFilterData = async () => {
    try {
      const [categoriesData, producersData, locationsData] = await Promise.all([
        getCategories(),
        getProducers(),
        getLocations()
      ]);
      
      setCategories(categoriesData);
      setProducers(producersData);
      setLocations(locationsData);
    } catch (error) {
      console.error('Error al cargar datos de filtros:', error);
    }
  };

  const handleFilterChange = (filterName, value) => {
    onFilterChange({ [filterName]: value });
  };

  return (
    <div className="product-filter">
      <div className="filter-header">
        <h3>Filtrar Productos</h3>
        <button 
          className="clear-filters-btn"
          onClick={onClearFilters}
        >
          Limpiar Filtros
        </button>
      </div>

      <div className="filter-group">
        <label htmlFor="search">Buscar</label>
        <input
          type="text"
          id="search"
          placeholder="Buscar productos..."
          value={filters.search}
          onChange={(e) => handleFilterChange('search', e.target.value)}
        />
      </div>

      <div className="filter-group">
        <label htmlFor="category">Categoría</label>
        <select
          id="category"
          value={filters.category}
          onChange={(e) => handleFilterChange('category', e.target.value)}
        >
          <option value="">Todas las categorías</option>
          {categories.map(category => (
            <option key={category.id} value={category.name}>
              {category.name}
            </option>
          ))}
        </select>
      </div>

      <div className="filter-group">
        <label htmlFor="producer">Productor</label>
        <select
          id="producer"
          value={filters.producer}
          onChange={(e) => handleFilterChange('producer', e.target.value)}
        >
          <option value="">Todos los productores</option>
          {producers.map(producer => (
            <option key={producer.id} value={producer.name}>
              {producer.name}
            </option>
          ))}
        </select>
      </div>

      <div className="filter-group">
        <label htmlFor="location">Ubicación</label>
        <select
          id="location"
          value={filters.location}
          onChange={(e) => handleFilterChange('location', e.target.value)}
        >
          <option value="">Todas las ubicaciones</option>
          {locations.map(location => (
            <option key={location.id} value={location.name}>
              {location.name}
            </option>
          ))}
        </select>
      </div>

      <div className="filter-group">
        <label htmlFor="priceMin">Precio Mínimo</label>
        <input
          type="number"
          id="priceMin"
          min="0"
          step="0.01"
          placeholder="$0.00"
          value={filters.priceMin}
          onChange={(e) => handleFilterChange('priceMin', e.target.value)}
        />
      </div>

      <div className="filter-group">
        <label htmlFor="priceMax">Precio Máximo</label>
        <input
          type="number"
          id="priceMax"
          min="0"
          step="0.01"
          placeholder="$999.99"
          value={filters.priceMax}
          onChange={(e) => handleFilterChange('priceMax', e.target.value)}
        />
      </div>
    </div>
  );
};

export default ProductFilter;
